import React, { Component } from 'react';
import {Button, FormGroup, FormControl, ControlLabel, Grid, Row, Col} from 'react-bootstrap';
import './dashboard.css';
import Label from './../../components/Label.js';
import {Animated} from "react-animated-css";
import Iframe from 'react-iframe';
import Tooltip from 'react-simple-tooltip';

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {greetingText:'Hi Admin, Good Morning - You were last logged in at 10 AM 21-11-2018'};

    this.onLogoutClick = this.onLogoutClick.bind(this);
  }

  onLogoutClick(event)
  {
    this.props.history.push('/');
  }

  render() {
    return (
        <div className="dashboard">
          <div className="menuHeader">
            <div className="userInfo">
              <Label text={this.state.greetingText}/>
            </div>

            {/*
              <div className="userInfo">
                <Label text="Hello Mr Brij"/>
              </div>
            */}
            <div>
            <ReactSimpleTooltip
                arrow={15}
                background="#000"
                border="#000"
                color="#fff"
                content="ðŸ˜Ž"
                fadeDuration={0}
                fadeEasing="linear"
                fixed={false}
                fontFamily="inherit"
                fontSize="inherit"
                offset={0}
                padding={16}
                placement="top"
                radius={0}
                zIndex={1}
              >
                <ReactSimpleTooltip>
                  Hover me !
                </ReactSimpleTooltip>
              </ReactSimpleTooltip>
            </div>
            <div>

              <img src={require('./../../resources/images/report.png')} className="logoutBtn"/>
            </div>

            <div>
              <img src={require('./../../resources/images/settings.png')} className="logoutBtn"/>
            </div>

            <div>
              <img src={require('./../../resources/images/logout.png')} className="logoutBtn" onClick={this.onLogoutClick}/>
            </div>

          </div>

          <div className="kibana">
          <Iframe url="https://demo.elastic.co"
            width="100%"
            height="100%"
            id="myId"
            className="kibanaDashboard"
            display="initial"
            position="relative"
            allowFullScreen/>
          </div>
        </div>
    );
  }
}

export default Dashboard;
